import React from "react";
import PopupWithForm from "./PopupWithForm";

function EditAvatarPopup({ isOpen, onClose }) {
    return (
        <PopupWithForm title="Обновить аватар" name="avatar" isOpen={isOpen} onClose={onClose} buttonText="Сохранить">
            <input
                type="url"
                name="avatar"
                id="popup__input-type-avatar"
                className="popup__input popup__input_type_avatar"
                placeholder="Ссылка на новый аватар"
                required
            />
            <span className="popup__input-error-message popup__input-type-avatar-error"></span>
        </PopupWithForm>
    );
}

export default EditAvatarPopup;
